import React from 'react'
import { Dropdown } from 'semantic-ui-react'

const stars = [
  {
    key: '1',
    text: '1',
    value: '1',
  },
  {
    key: '2',
    text: '2',
    value: '2',
  },
  {
    key: '3',
    text: '3',
    value: '3',
  },
  {
    key: '4',
    text: '4',
    value: '4',
  },
  {
    key: '5',
    text: '5',
    value: '5',
  },
]

const FishingDropdown = () => (
  <Dropdown
    label='Nota para Pescaria'
    placeholder='Nota'
    fluid
    selection
    options={stars}
  />
)

export default FishingDropdown
